import React, { Component } from "react";
import { Card, Statistic, Icon, DatePicker, Steps } from "antd";
import ReactEcharts from "echarts-for-react";
import moment from 'moment'
import {
  Chart,
  Geom,
  Axis,
  Tooltip,
  Legend,
} from "bizcharts";
import "./home.less";

const { RangePicker } = DatePicker;
const dateFormat = 'YYYY/MM/DD'
const { Step } = Steps;
/* 首页路由 */
export default class Home extends Component {
  state = {
    key: "tab1",
    noTitleKey: "article",
    sales: [23, 24, 18, 25, 27], //销量
    stores: [12, 54, 18, 45, 9] //数组
  };
  getOption = (sales, stores) => {
    return {
      title: {
        // text: 'ECharts入门示例'
      },
      tooltip: {},
      legend: {
        data: ['销量', '库存']
      },
      xAxis: {
        data: ['Mon', 'Tue', 'Wed', 'Thu', 'Fri']
      },
      yAxis: {},
      series: [
        {
          name: '销量',
          type: 'bar',
          data: sales
        },
        {
          name: '库存',
          type: 'bar',
          data: stores
        }
      ]
    }
  }

  render() {
    const tabListNoTitle = [
      {
        key: "article",
        tab: "访问量",
      },
      {
        key: "app",
        tab: "销售量",
      },
    ];
    const contentListNoTitle = {
      article: <p>article content</p>,
      app: <p>app content</p>,
    };
    const data = [
      {
        month: "Jan",
        city: "a",
        temperature: 7,
      },
      {
        month: "Jan",
