        city: "c",
        temperature: 14.2,
      },
      {
        month: "Mar",
        city: "a",
        temperature: 9.5,
      },
      {
        month: "Mar",
        city: "b",
        temperature: 5.7,
      },
      {
        month: "Mar",
        city: "c",
        temperature: 15.7,
      },
      {
        month: "Apr",
        city: "a",
        temperature: 14.5,
      },
      {
        month: "Apr",
