        temperature: 21.5,
      },
      {
        month: "Jun",
        city: "a",
        temperature: 15.2,
      },
      {
        month: "Jun",
        city: "c",
        temperature: 25.4,
      },
      {
        month: "Jul",
        city: "b",
        temperature: 27.2,
      },
      {
        month: "Jul",
