      },
      {
        month: "Oct",
        city: "a",
        temperature: 10.3,
      },
      {
        month: "Oct",
        city: "c",
        temperature: 20.3,
      },
      {
        month: "Nov",
        city: "b",
        temperature: 13.9,
      },
      {
        month: "Nov",
