        city: "c",
        temperature: 4.8,
      },
      {
        month: "Dec",
        city: "c",
        temperature: 14.8,
      },
    ];
    const cols = {
      month: {
        range: [0, 1],
      },
    };
    const tabBarExtraContent = (
      <RangePicker
        defaultValue={[
          moment("2022/11/20", dateFormat),
          moment("2022/11/21", dateFormat),
        ]}
        format={dateFormat}
      />
    );
    const {sales, stores} = this.state
    return (
      <div>
        <div className="div-card-chart">
          <Card title="商品总量" className="card-product">
            <Statistic
              title="周同比"
              value={21.65}
              precision={2}
              valueStyle={{ color: "#3f8600" }}
              prefix={<Icon type="arrow-up" />}
              suffix="%"
            />
            <Statistic
              title="日同比"
              value={9.31}
              precision={2}
              valueStyle={{ color: "#cf1322" }}
              prefix={<Icon type="arrow-down" />}
              suffix="%"
            />
          </Card>
          <Chart
            height={250}
            width={800}
            className="chart-line"
            data={data}
            scale={cols}
            autoFit
          >
            <Legend
              marker={{
                symbol: (x, y, radius) => {
                  const r = radius / 2;
                  return [
                    ["M", x - radius, y],
                    ["A", r, r, 0, 0, 1, x, y],
                    ["A", r, r, 0, 0, 0, x + radius, y],
                  ];
                },
                style: {
                  fill: "",
                },
              }}
            />
            <Axis name="month" />
            <Axis
              name="temperature"
              label={{
                formatter: (val) => `${val}万个`,
              }}
            />
            <Tooltip
              domStyles={{
                "g2-tooltip": {
                  boxShadow: "none",
                  color: "#fff",
                  backgroundColor: "#222",
                },
              }}
              crosshairs={{
                type: "y",
              }}
              style={{
                color: "red",
              }}
            />
            <Geom
              type="line"
              position="month*temperature"
              size={2}
              color={"city"}
            />
            <Geom
              type="point"
              position="month*temperature"
              size={4}
              shape={"circle"}
              color={"city"}
              style={{
                stroke: "#fff",
                lineWidth: 1,
              }}
            />
          </Chart>
        </div>
        <Card
          tabBarExtraContent={tabBarExtraContent}
          className="div-card2"
          tabList={tabListNoTitle}
          activeTabKey={this.state.noTitleKey}
          onTabChange={(key) => {
            this.onTabChange(key, "noTitleKey");
          }}
        >
          {/* <Card title="访问趋势" style={{ width: 700 }} className="fangwenqushi"> */}
            <ReactEcharts option={this.getOption(sales, stores)} style = {{width: 700}} className=""/>
          {/* </Card> */}
          <Card title="任务" style={{width: 250}} className="renwu">
            <Steps progressDot current={1} direction="vertical" size="small">
              <Step title="新版本迭代会" />
              <Step title="完成网站设计初版" />
              <Step title="联调接口" description="功能验收" />
              <Step title="登录功能设计" description="权限验证" />
            </Steps>
          </Card>
        </Card>
      </div>
    );
  }
}
